/*Table structure for table `c_bankuai_xishu` */

DROP TABLE IF EXISTS `c_bankuai_xishu`;

CREATE TABLE `c_bankuai_xishu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `c_date` varchar(20) DEFAULT NULL COMMENT '日期',
  `c_value` int(11) DEFAULT NULL COMMENT '值',
  `bankuai_name` varchar(20) DEFAULT NULL COMMENT '板块名称',
  `bankuai_daima` varchar(200) DEFAULT NULL COMMENT '板块代码',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新人',
  `delete_tag` varchar(2) DEFAULT NULL COMMENT '删除标志1正常2删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `bankuai_weiyi` (`c_date`,`bankuai_daima`),
  KEY `bankuai_pri` (`bankuai_daima`)
) ENGINE=InnoDB AUTO_INCREMENT=3335 DEFAULT CHARSET=utf8 COMMENT='板块系数';

