/*Table structure for table `cdapan` */

DROP TABLE IF EXISTS `cdapan`;

CREATE TABLE `cdapan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `c_name` varchar(20) DEFAULT NULL COMMENT '股票名称',
  `c_daima` varchar(10) DEFAULT NULL COMMENT '股票代码',
  `c_status` varchar(20) DEFAULT NULL COMMENT '当前状态1没停牌2停牌',
  `c_date` varchar(30) DEFAULT NULL COMMENT '更新日期',
  `c_zhishu` double DEFAULT NULL COMMENT '收盘价格',
  `c_20_zuigao` double DEFAULT NULL COMMENT '20日最低价格',
  `c_20_zuidi` double DEFAULT NULL COMMENT '20日最高价格',
  `c_zuori_yinzi` double DEFAULT NULL COMMENT '当前复权因子',
  `delete_tag` varchar(2) DEFAULT '1' COMMENT '删除标志1正常2删除',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新人',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `c_daima_pri` (`c_daima`)
) ENGINE=InnoDB AUTO_INCREMENT=3201 DEFAULT CHARSET=utf8 COMMENT='大盘数据';

